/* Function  structure for function  `Create_patient_id` */

/*!50003 DROP FUNCTION IF EXISTS `Create_patient_id` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`sys`@`192.168.10.11` FUNCTION `Create_patient_id`(id int,last_name varchar(50)) RETURNS varchar(10) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
    DETERMINISTIC
BEGIN
	DECLARE myid VARCHAR(10);
	set myid=(SELECT CONCAT(upper(SUBSTR(last_name,1,1)), LPAD(id,7,'0')));
	
	return myid;
    END */$$
DELIMITER ;

/*Table structure for table `v_appointment_state` */

DROP TABLE IF EXISTS `v_appointment_state`;

/*!50001 DROP VIEW IF EXISTS `v_appointment_state` */;
/*!50001 DROP TABLE IF EXISTS `v_appointment_state` */;

/*!50001 CREATE TABLE  `v_appointment_state`(
 `app_id` int(11) ,
 `patient_id` int(11) ,
 `user_id` int(11) ,
 `patient_name` varchar(101) ,
 `display_id` varchar(12) ,
 `appointment_date` datetime ,
 `title` varchar(150) ,
 `status` varchar(255) 
)*/;

/*Table structure for table `v_search_patient` */

DROP TABLE IF EXISTS `v_search_patient`;

/*!50001 DROP VIEW IF EXISTS `v_search_patient` */;
/*!50001 DROP TABLE IF EXISTS `v_search_patient` */;

/*!50001 CREATE TABLE  `v_search_patient`(
 `id` int(11) ,
 `fullname` varchar(101) ,
 `display_id` varchar(12) ,
 `phone_number` varchar(15) ,
 `display_name` varchar(255) 
)*/;

/*View structure for view v_appointment_state */

/*!50001 DROP TABLE IF EXISTS `v_appointment_state` */;
/*!50001 DROP VIEW IF EXISTS `v_appointment_state` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`sys`@`%` SQL SECURITY DEFINER VIEW `v_appointment_state` AS select `t1`.`id` AS `app_id`,`t2`.`patient_id` AS `patient_id`,`t1`.`user_id` AS `user_id`,replace(concat(`t3`.`last_name`,' ',`t3`.`first_name`),' ',' ') AS `patient_name`,`t2`.`display_id` AS `display_id`,`t1`.`appointment_date` AS `appointment_date`,`t1`.`title` AS `title`,`t1`.`status` AS `status` from ((`appointment` `t1` join `patient` `t2` on((`t1`.`patient_id` = `t2`.`contact_id`))) join `contact` `t3` on((`t2`.`contact_id` = `t3`.`id`))) */;

/*View structure for view v_search_patient */

/*!50001 DROP TABLE IF EXISTS `v_search_patient` */;
/*!50001 DROP VIEW IF EXISTS `v_search_patient` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`sys`@`%` SQL SECURITY DEFINER VIEW `v_search_patient` AS select `t1`.`id` AS `id`,replace(concat(`t1`.`last_name`,' ',`t1`.`first_name`),' ',' ') AS `fullname`,`t2`.`display_id` AS `display_id`,`t1`.`phone_number` AS `phone_number`,`t1`.`display_name` AS `display_name` from (`contact` `t1` join `patient` `t2` on((`t1`.`id` = `t2`.`contact_id`))) */;

